export default function ContainedButtons() {
  const classes = useStyles();

  return (
    <div className={classes.button}>
      <Button
        variant="contained"
        style={{ backgroundColor: "green", color: "white", width: "350px" }}
      >
        haaaa-i knopken
      </Button>
    </div>
  );
}
